BEGIN TRY
    BEGIN TRANSACTION;

        DECLARE @ProgramData TABLE (
            SchoolName     NVARCHAR(255),
            ProgramName    NVARCHAR(255),
            AwardType      NVARCHAR(100), -- TODO: Add awardType to values
            getStartedUrl  NVARCHAR(255),
            Search_CIP     NVARCHAR(50),
            OfferedOnline  NVARCHAR(50),
            ProgramLength  NVARCHAR(1000),
            costSummary    NVARCHAR(1000),
            fees           NVARCHAR(255)
        );


        -- Upsert edu_providers
        MERGE INTO dbo.edu_providers AS target
        USING (
            SELECT DISTINCT SchoolName AS name FROM @ProgramData
        ) AS src
        ON target.name = src.name
        WHEN NOT MATCHED THEN
          INSERT (id, name, created_at, updated_at)
          VALUES (NEWID(), src.name, GETDATE(), GETDATE());

        -- Upsert programs
        MERGE INTO dbo.programs AS target
        USING (
            SELECT DISTINCT ProgramName AS title FROM @ProgramData
        ) AS src
        ON target.title = src.title
        WHEN NOT MATCHED THEN
          INSERT (id, title, createdAt, updatedAt)
          VALUES (NEWID(), src.title, GETDATE(), GETDATE());

        -- Upsert provider_programs
    ;WITH ProgramSource AS (
        SELECT
            ep.id AS edu_provider_id,
            p.id AS program_id,
            pd.getStartedUrl,
            pd.Search_CIP,
            pd.AwardType AS awardType,
            CASE WHEN LOWER(pd.OfferedOnline) = 'online' THEN 'Online' ELSE 'In-person' END AS locationType,
            pd.ProgramLength,
            pd.costSummary,
            pd.fees,
            ROW_NUMBER() OVER (
                PARTITION BY ep.id, p.id, pd.AwardType
                ORDER BY (SELECT NULL)
                ) AS rn
        FROM @ProgramData pd
                 INNER JOIN dbo.edu_providers ep ON ep.name = pd.SchoolName
                 INNER JOIN dbo.programs p ON p.title = pd.ProgramName
        )
        MERGE INTO dbo.provider_programs AS target
    USING (
        SELECT * FROM ProgramSource WHERE rn = 1
    ) AS src
    ON target.edu_provider_id = src.edu_provider_id
        AND target.program_id = src.program_id
    WHEN NOT MATCHED THEN
        INSERT (
            training_program_id,
            program_id,
            edu_provider_id,
            awardType,
            getStartedUrl,
            cipCode,
            locationType,
            programLength,
            costSummary,
            fees,
            createdAt,
            updatedAt
        )
        VALUES (
                   NEWID(),
                   src.program_id,
                   src.edu_provider_id,
                   src.awardType,
                   src.getStartedUrl,
                   src.Search_CIP,
                   src.locationType,
                   src.programLength,
                   src.costSummary,
                   src.fees,
                   GETDATE(),
                   GETDATE()
               );

    COMMIT;
END TRY
BEGIN CATCH
    IF @@TRANCOUNT > 0 ROLLBACK;
    THROW;
END CATCH;